import React, { useEffect, useRef } from 'react';
import Chart from 'chart.js/auto';
import './metricsadmin.css'; // Import the separated CSS file

const Metrics = () => {
  const ctxTotalPrice = useRef(null);
  const ctxAveragePrice = useRef(null);
  const ctxHighestPrice = useRef(null);

  useEffect(() => {
    const orcamentos = [100, 200, 300, 400, 500]; // Example data, replace with actual data

    const totalPrice = orcamentos.reduce((acc, val) => acc + val, 0);
    const averagePrice = (totalPrice / orcamentos.length).toFixed(2);
    const highestPrice = Math.max(...orcamentos);

    // Destroy existing charts if they exist
    if (ctxTotalPrice.current !== null) {
      ctxTotalPrice.current.destroy();
    }
    if (ctxAveragePrice.current !== null) {
      ctxAveragePrice.current.destroy();
    }
    if (ctxHighestPrice.current !== null) {
      ctxHighestPrice.current.destroy();
    }

    // Create new charts
    ctxTotalPrice.current = new Chart(ctxTotalPrice.current, {
      type: 'bar',
      data: {
        labels: ['Preço total'],
        datasets: [{
          label: 'Preço total',
          data: [totalPrice],
          backgroundColor: ['rgba(54, 162, 235, 0.2)'],
          borderColor: ['rgba(54, 162, 235, 1)'],
          borderWidth: 1
        }]
      },
      options: {
        scales: {
          y: {
            beginAtZero: true
          }
        }
      }
    });

    ctxAveragePrice.current = new Chart(ctxAveragePrice.current, {
      type: 'bar',
      data: {
        labels: ['Média de preço'],
        datasets: [{
          label: 'Média de preço',
          data: [averagePrice],
          backgroundColor: ['rgba(75, 192, 192, 0.2)'],
          borderColor: ['rgba(75, 192, 192, 1)'],
          borderWidth: 1
        }]
      },
      options: {
        scales: {
          y: {
            beginAtZero: true
          }
        }
      }
    });

    ctxHighestPrice.current = new Chart(ctxHighestPrice.current, {
      type: 'bar',
      data: {
        labels: ['Preço mais alto'],
        datasets: [{
          label: 'Preço mais alto',
          data: [highestPrice],
          backgroundColor: ['rgba(255, 99, 132, 0.2)'],
          borderColor: ['rgba(255, 99, 132, 1)'],
          borderWidth: 1
        }]
      },
      options: {
        scales: {
          y: {
            beginAtZero: true
          }
        }
      }
    });

    // Cleanup function to destroy charts when component unmounts
    return () => {
      if (ctxTotalPrice.current) ctxTotalPrice.current.destroy();
      if (ctxAveragePrice.current) ctxAveragePrice.current.destroy();
      if (ctxHighestPrice.current) ctxHighestPrice.current.destroy();
    };

  }, []);

  return (
    <div className="container-fluid">
      {/* Your JSX for displaying charts */}
      <div className="row">
        {/* Code for displaying charts */}
        <div id="sidebar" className="col-md-3">
          <div className="logo">
            <img src="frontend/public/images/Logos/logotipo copy.svg" alt="Logo" />
          </div>
          <ul className="list-unstyled components">
            <li>
              <a href="#"><i className="fas fa-ticket-alt"></i> Tickets</a>
            </li>
            {/* Other list items */}
          </ul>
          <div className="logout-button">
            <button className="btn btn-primary">Terminar Sessão</button>
          </div>
        </div>

        <div id="content" className="col-md-9">
          <h2 style={{ marginBottom: '3%' }}>Métricas de vendas</h2>

          <div className="row">
            {/* Cards for displaying charts */}
            <div className="col-md-4">
              <div className="card widget">
                <div className="card-body">
                  <h5 className="card-title">Preço total</h5>
                  <div className="chart-container">
                    <canvas ref={ctxTotalPrice}></canvas>
                  </div>
                </div>
              </div>
            </div>
            {/* Other chart cards */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Metrics;
